Defendant Aundra B Sewell in court with Attorney Joel H. Rosenthal.  
Michael Thurston appeared for the State of Wisconsin.  
Deputy Court Clerk: dds.

Defendant prepared to enter change of plea.  Hearing proceeded.  Amendments to criminal complaint set forth by the state.  Defendant's name amended to AUDRA B. SEWELL.  Negotiations set forth by the state.

COUNT 1:  The defendant was advised of her constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  

Statements made as to sentencing.  The Court finds the state is in compliance with the victim rights legislation.  The Court orders restitution set at zero.

The Court sentenced defendant to serve 6 MONTHS in the House of Correction with Huber release for employment and treatment.  

Court STAYED this sentence and placed the defendant on PROBATION for a period of 12 MONTHS with the following conditions:

-Defendant to serve 3 days in the House of Correction- STAYED until 10-27-15.  Defendant to report no later than 12 pm.
-Cooperate with AODA assessment and any recommended treatment;
-Absolute sobriety- submit to random urine screens;
-Perform 100 hours of community service;
-No driving of any transportation vehicle containing children or adults during probation period;
-Defendant to pay Court costs and all applicable surcharges (including dna), and assessments during term of probation; any remaining balance to convert to civil judgment;

Filed:
-Sentencing Referral Form;
-Notice of Right to Seek Postconviction Relief.
